import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';

const TodoList = (props) => {
    return
    (
        <div className="todo_style">
        <span> <DeleteIcon/></span>
         <li>{props.text}</li>
        </div>
        );
};

export default TodoList;
